import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';
import { createStore, compose, applyMiddleware } from 'redux';
import thunk from 'redux-thunk';
import { Provider } from 'react-redux';
import * as firebase from 'firebase';
import { BrowserRouter, Route } from "react-router-dom"


var config = {
    apiKey: "AIzaSyAlIzKpOr77zZXwQ_TPrze9mBQD29XVQAs",
    authDomain: "fantasy-cod.firebaseapp.com",
    databaseURL: "https://fantasy-cod.firebaseio.com",
    projectId: "fantasy-cod",
    storageBucket: "fantasy-cod.appspot.com",
    messagingSenderId: "860216149470"
  };
firebase.initializeApp(config);





ReactDOM.render(
<BrowserRouter>
  <Route path="/" component={App} />
</BrowserRouter>
, 

document.getElementById('root'));

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
